INSERT INTO `wp_options` VALUES (256,'facetwp_updater_response','{\"facetwp\":{\"name\":\"FacetWP\",\"slug\":\"facetwp\",\"version\":\"3.9.4\",\"requires\":\"4.9\",\"tested\":\"5.8.3\",\"downloaded\":0,\"last_updated\":\"2022-01-21 11:52:37\",\"sections\":{\"description\":\"\",\"changelog\":\"<h4>3.9.4<\\/h4>\\r\\n<ul>\\r\\n<li>Jan 12, 2021<\\/li>\\r\\n<li>Fix: fSelect counts duplicating during paging<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<h4>3.9.3<\\/h4>\\r\\n<ul>\\r\\n<li>Dec 30, 2021<\\/li>\\r\\n<li>New: added UI setting to toggle accessibility features<\\/li>\\r\\n<li>Improved: checkboxes - auto-expand if a checkbox within an overflow is selected<\\/li>\\r\\n<li>Improved: layout builder - HTML items automatically parse shortcodes<\\/li>\\r\\n<li>Improved: layout builder - added \\\"is-empty\\\" CSS class for empty items<\\/li>\\r\\n<li>Improved: fSelect - replaced CSS class \\\"hidden\\\" with \\\"fs-hidden\\\" to prevent conflicts<\\/li>\\r\\n<li>Improved: a11y - added `aria-label` attribute to sort facets<\\/li>\\r\\n<li>Improved: a11y - added `aria-current` attribute to the pager\'s current page<\\/li>\\r\\n<li>Improved: a11y - better support for checkbox facets<\\/li>\\r\\n<li>Improved: a11y - automatically exclude ghost choices from ARIA<\\/li>\\r\\n<li>Fix: handle edge case of `parse_url()` returning false<\\/li>\\r\\n<li>Fix: doc links<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<h4>3.9.2<\\/h4>\\r\\n<ul>\\r\\n<li>Dec 2, 2021<\\/li>\\r\\n<li>New: added `facetwp_facet_autocomplete_limit` hook to control max results<\\/li>\\r\\n<li>New: added \\\"Comment count\\\" as a sort option (layout builder and sort facets)<\\/li>\\r\\n<li>Improved: moved some layout builder CSS into `front.css` for easier overriding<\\/li>\\r\\n<li>Improved: better instruction text for the query builder\'s \\\"value\\\" box<\\/li>\\r\\n<li>Improved: checkbox facets - show the \\\"Soft limit\\\" setting only when \\\"Hierarchial\\\" is off<\\/li>\\r\\n<li>Fix: proximity facet \\\"Source other\\\" setting (props Jenny)<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<h4>3.9.1<\\/h4>\\r\\n<ul>\\r\\n<li>Nov 2, 2021<\\/li>\\r\\n<li>Fix: PHP \\\"null coalescing operator\\\" error for sites running PHP 5<\\/li>\\r\\n<li>Fix: PHP \\\"undefined index\\\" warning for the sort facet<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<h4>3.9<\\/h4>\\r\\n<ul>\\r\\n<li>Oct 19, 2021<\\/li>\\r\\n<li>Important: <a href=\\\"https:\\/\\/facetwp.com\\/deprecations-removed-in-3-9\\/\\\" target=\\\"_blank\\\">Some deprecated JS method names have been removed<\\/a><\\/li>\\r\\n<li>New: <a href=\\\"https:\\/\\/facetwp.com\\/documentation\\/facets\\/facet-types\\/sort\\/\\\" target=\\\"_blank\\\">sort facets<\\/a>! Create your own sort boxes from within the admin UI<\\/li>\\r\\n<li>New: inheritable facets! Facet types can now inherit the UI from other facet types. <a href=\\\"https:\\/\\/facetwp.com\\/add-ons\\/range-list\\/\\\" target=\\\"_blank\\\">Range List<\\/a> is the first add-on to incorporate this feature, letting you choose whether to display a dropdown, checkboxes, radio, etc.<\\/li>\\r\\n<li>New: facet field registration (more info coming in 4.0)<\\/li>\\r\\n<li>Improved: smarter \\\"re-index\\\" notifier, now ignores non-indexable facets (search, pager, etc)<\\/li>\\r\\n<li>Improved: simplified the internal `get_svg` method<\\/li>\\r\\n<li>Improved: removed unnecessary Vue dependencies, updated libs<\\/li>\\r\\n<li>Improved: tweaked admin UI font sizes, other styles<\\/li>\\r\\n<li>Improved: updated admin labels and tooltips for more clarity<\\/li>\\r\\n<li>Improved: hide the data source \\\"ACF\\\" header if no ACF fields exist<\\/li>\\r\\n<li>Improved: search facet - set autocomplete = \\\"off\\\"<\\/li>\\r\\n<li>Fix: fUtil - return empty results when the selector is an empty string (jQuery parity)<\\/li>\\r\\n<li>Updated translations<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<h4>3.8.12<\\/h4>\\r\\n<ul>\\r\\n<li>Sept 17, 2021<\\/li>\\r\\n<li>Improved: SearchWP - faster speed by loading only necessary data (props Remco)<\\/li>\\r\\n<li>Improved: SearchWP - support additional args passed into SWP_Query (post_type, post_status, meta_query, etc)<\\/li>\\r\\n<li>Improved: A11y - added ARIA support for fSelect facets<\\/li>\\r\\n<li>Improved: Layout builder - add row count class (r1, r2, etc) to the `.fwpl-result` element<\\/li>\\r\\n<li>Fix: fUtil - `.prev`, `.next`, `.find` and `closest` methods now support multiple selectors<\\/li>\\r\\n<li>Fix: the above fUtil change fixes previously-broken Conditional Logic actions<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<h4>3.8.11<\\/h4>\\r\\n<ul>\\r\\n<li>August 30, 2021<\\/li>\\r\\n<li>Improved: smarter slider range (now dynamically adjusts even with selected values)<\\/li>\\r\\n<li>Fix: slider pageload quirks (<a href=\\\"https:\\/\\/feedback.facetwp.com\\/feedback\\/11\\/slider-pageload-quirks\\\" target=\\\"_blank\\\">more info<\\/a>)<\\/li>\\r\\n<li>Updated noUiSlider<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<h4>3.8.10<\\/h4>\\r\\n<ul>\\r\\n<li>August 20, 2021<\\/li>\\r\\n<li>Fix: WooCommerce - some choices weren\'t showing for variation-based facets in \\\"OR\\\" mode<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<h4>3.8.9<\\/h4>\\r\\n<ul>\\r\\n<li>August 9, 2021<\\/li>\\r\\n<li>Improved: use wp_date() instead of DateTime->format() for i18n<\\/li>\\r\\n<li>Improved: 3 new pager \\\"Result counts\\\" tags: [page], [per_page] and [total_pages]<\\/li>\\r\\n<li>Improved: prevent pager \\/ per page \\/ sort values from getting stored in `FWP.facets` JS object<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<h4>3.8.8<\\/h4>\\r\\n<ul>\\r\\n<li>July 9, 2021<\\/li>\\r\\n<li>Fix: move indexing to `init:1000` to allow sufficient time for post type \\/ taxonomy registration<\\/li>\\r\\n<li>Fix: radio facets - force in \\\"OR\\\" mode (props Kari S.)<\\/li>\\r\\n<li>Fix: date picker - edge case offset issue (props Lucas T.)<\\/li>\\r\\n<li>Fix: MS Edge requires JS `catch(err)` instead of `catch` (props George H.)<\\/li>\\r\\n<li>Updated Norwegian translations (props Johan F.)<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<h4>3.8.7<\\/h4>\\r\\n<ul>\\r\\n<li>June 29, 2021<\\/li>\\r\\n<li>Improved: removed need for `float: right` CSS on Star Rating facets<\\/li>\\r\\n<li>Improved: indexer - ensure that `post_author` user exists<\\/li>\\r\\n<li>Improved: fetch API - include `term_id` in the response<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<h4>3.8.6<\\/h4>\\r\\n<ul>\\r\\n<li>May 25, 2021<\\/li>\\r\\n<li>Fix: issue caused from 3.8.5 script versioning change<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<h4>3.8.5<\\/h4>\\r\\n<ul>\\r\\n<li>May 24, 2021<\\/li>\\r\\n<li>New: `facetwp_facet_display_value` hook (to customize choice labels)<\\/li>\\r\\n<li>New: `facetwp_facet_hierarchy_arrow` (to customize the \\\"Back\\\" arrow)<\\/li>\\r\\n<li>New: `get_terms` helper method to bypass 3rd party hooks (*ahem* WPML)<\\/li>\\r\\n<li>Improved: redesigned the admin status bar, other design tweaks<\\/li>\\r\\n<li>Improved: support versioning of add-on scripts (to bust browser cache)<\\/li>\\r\\n<li>Improved: Autocomplete - translatable UI strings<\\/li>\\r\\n<li>Fix: PHP8 \\\"optional before required parameters\\\" deprecation notice<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<h4>3.8.4<\\/h4>\\r\\n<ul>\\r\\n<li>May 6, 2021<\\/li>\\r\\n<li>Improved: `$params[\'place_details\']` is now available when indexing ACF Google Map fields<\\/li>\\r\\n<li>Improved: A11y - support Hierarchy fields<\\/li>\\r\\n<li>Improved: Slider facet - the \\\"Compare type\\\" UI setting is now always available<\\/li>\\r\\n<li>Fix: Autocomplete facet - timing issues with some CSS-based templates<\\/li>\\r\\n<li>Fix: Gutenberg (10.5.0) - ignore the `wp_template` post type<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<h4>3.8.3<\\/h4>\\r\\n<ul>\\r\\n<li>April 22, 2021<\\/li>\\r\\n<li>Improved: more tooltip info for the slider facet\'s \\\"Format\\\" setting<\\/li>\\r\\n<li>Fix: fully reset the indexer when purging the index table<\\/li>\\r\\n<li>Fix: Dropdown - restore support for jQuery-based enhancement libs (select2, chosen, etc)<\\/li>\\r\\n<li>Fix: PHP notice caused by the \\\"load_jquery\\\" setting<\\/li>\\r\\n<li>Fix: updated vue-select.js to resolve scrolling issues<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<h4>3.8.2<\\/h4>\\r\\n<ul>\\r\\n<li>April 6, 2021<\\/li>\\r\\n<li>Improved: fUtil.js - enable event bubbling by default<\\/li>\\r\\n<li>Improved: fComplete.js - automatically close after selection<\\/li>\\r\\n<li>Improved: API - fetch method accepts \\\"application\\/json\\\" (docs updated)<\\/li>\\r\\n<li>Improved: use jQuery if available for document.ready, sort, and per-page boxes (back compat)<\\/li>\\r\\n<li>Improved: cache FWP_Helper->get_term_depths()<\\/li>\\r\\n<li>Improved: fSelect.js - trigger native JS \\\"change\\\" event<\\/li>\\r\\n<li>Fix: fSelect.js - preserve existing class names<\\/li>\\r\\n<li>Fix: fSelect.js - restore \\\"fs-open\\\" class when open<\\/li>\\r\\n<li>Fix: restored \\\"Go\\\" button for autocomplete facets<\\/li>\\r\\n<li>Fix: JS error for \\\"user selections\\\" when no results<\\/li>\\r\\n<li>Fix: JS error within accessibility.js<\\/li>\\r\\n<li>Updated package.json<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<h4>3.8.1<\\/h4>\\r\\n<ul>\\r\\n<li>March 19, 2021<\\/li>\\r\\n<li>Fix: better JSON error handling (due to 3rd party output buffering issues)<\\/li>\\r\\n<li>Fix: better support for 3rd party caching and script deferring (i.e. Autoptimize)<\\/li>\\r\\n<li>Fix: restored the `facetwp\\/ajax_settings` JS hook<\\/li>\\r\\n<li>Fix: changed `init` hook priority from 10 to 20, some post types (i.e. Pods) were not indexing<\\/li>\\r\\n<li>Fix: load more button<\\/li>\\r\\n<li>Fix: hierarchical checkbox \\\"expand\\\" buttons<\\/li>\\r\\n<\\/ul>\\r\\n\\r\\n<h4>3.8<\\/h4>\\r\\n<ul>\\r\\n<li>March 16, 2021<\\/li>\\r\\n<li>Important: 3.8 is a <a href=\\\"https:\\/\\/facetwp.com\\/whats-new-in-facetwp-3-8\\/\\\" target=\\\"_blank\\\">MAJOR REWRITE<\\/a>. Please test first on a staging site!<\\/li>\\r\\n<li>New: removed jQuery dependency from FacetWP core<\\/li>\\r\\n<li>New: fUtil helper JS library (JS abstractions)<\\/li>\\r\\n<li>New: fDate date picker JS library<\\/li>\\r\\n<li>New: fTip tooltip JS library<\\/li>\\r\\n<li>New: fComplete autocomplete JS library<\\/li>\\r\\n<li>New: added \\u201csettings\\u201d to Debug Mode for faster debugging<\\/li>\\r\\n<li>Improved: modernized and refactored front-end JS code<\\/li>\\r\\n<li>Improved: removed jQuery libraries (query-autocomplete, jquery-powertip, etc)<\\/li>\\r\\n<li>Improved: complete rewrite of fSelect JS library<\\/li>\\r\\n<li>Improved: raw data is now sent on AJAX requests (less payload)<\\/li>\\r\\n<li>Improved: update checks are now made via HTTPS<\\/li>\\r\\n<li>Improved: removed upgrade routines > 3 years old<\\/li>\\r\\n<li>Improved: fSelect - simplified accents\\/diacritics removal code<\\/li>\\r\\n<li>Improved: add proximity \\u201clocate me\\u201d to keyboard nav<\\/li>\\r\\n<\\/ul>\"},\"url\":\"https:\\/\\/facetwp.com\",\"package\":\"\",\"homepage\":\"https:\\/\\/facetwp.com\\/\",\"rating\":100,\"num_ratings\":1,\"contributors\":{\"mgibbs189\":{\"profile\":\"https:\\/\\/twitter.com\\/mgibbs189\",\"avatar\":\"https:\\/\\/secure.gravatar.com\\/avatar\\/ce6607d5fb834cbfc538bce124e8ddd3?s=96&d=monsterid\",\"display_name\":\"Matt Gibbs\"}}}}','no');
